message:
@AndroidManifest:
Added a parent activity to CompareCategoriesActivity.java

@CompareCategoriesActivity.java:
Work in Progress

@ListOfIndicators.java:
Work in Progress

@CompareCategoriesActivity.java:
- Categories now being loaded reflect the user's initial selection.

@MapActivity.java:
- Changed <HashMap> Marker to <Map> Marker to utilise Polymorphism.

@SelectionActivity.java:
- Bug fix where the user could go to the next activity without selecting
any custom categories.

@activity_selection.xml:
- Changed button behaviour (change colours upon interaction).

@button_view.xml:
- New xml file containing the specified behaviour of buttons.

@colours.xml:
- Added a new colour (transparent).

@MapActivity.java:
- Changed availableCountries & selectedCountries from ArrayList<Country>
to List<Country> to utilise Polymorphism.

@Country.java:
- Changed method getAllCountries to return a List object instead of
ArrayList to take utilise Polymorphism.

@WorldlyController.java:
- Added three methods to class (loadState() & saveState() &
getCategories());
- Changed some field names;
- Added the method call loadState() to the constructor.

@CachingEngine.java:
- Major code overhaul, modified code structure to accomodate additional
methods whilst numerous new ones.

@activity_selection.xml:
Modified layout to display a description for every button.

@strings.xml:
Modified some of the strings used in activity_selection.

@SelectionActivity.java:
Added code to handle onClick events from TextViews

@CategoriesListAdapter.java:
Merged class into CompareExpandableListAdapter.java

@CompareExpandableListAdapter.java
See above.

@CompareCategoriesActivity.java
Changed the adapter used to point to the renamed class.

@CategoriesActivity.java:
Added listeners to class

@CategoriesListAdapter.java:
A few tweaks

@AndroidManifest.xml:
Modified the launcher activity to test newly created activity

@strings.xml:
Added a new String

@activity_categories.xml:
New layout used to display an ExpandableListView

@list_child.xml:
New layout used to display a single child element of a list

@list_group.xml:
New layout used to display a single group of a list

@categories.xml:
Default menu file automatically created by Eclipse

@CategoriesActivity.java
Source code for new activity

@CategoriesListAdapter.java
Source code for the implementation of the adapter used in the
ExpandableListAdapter

@Country.java:
Changed the method call chechCachedCountries to getCachedCountries

@CachingEngine.java:
Added comments and modified code logic slightly

@AndroidManifest.xml:
-	Added a new activity (activity_selection) and assigned it as the
launcher activity;
-	Assigned activity_selection as the parent of main_activity.

@MainActivity.java:
-	Added code to handle the "UP" actions (go back to the parent
activity).

@activity_selection.xml:
-	New activity layout file

@selection.xml:
-	New activity menu file

@SelectionActivity.java
-	New java file

@Country.java : Changed method call fetchAllCountriesData of class
QuerySystem to getAllCountriesData.

@QuerySystem.java : See above.

@JSONCore.java : Modified logic slightly (added ternary operator to
return clause).

@Indicator.java : Added comments to getters and setters.
